import React from 'react';

const Navbar = () => {
  return (
    <div>
      <nav className='navbar bg-dark'>
        <h1>
          <a href='index.html'>
            <i className='fas fa-code'></i> סקר שקל
          </a>
        </h1>
        <ul>
          <li>
            <a href='profiles.html'>Developers</a>
          </li>
          <li>
            <a href='register.html'>רישום</a>
          </li>
          <li>
            <a href='login.html'>התחברות</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
